<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Rhino to Web - Layers & Overlays</title>
  <style>
    body { font-family: Inter, -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, sans-serif; margin: 0; padding: 0; background:#fff; color:#222; }
    .container { display:flex; min-height: 100vh; }
    .sidebar { width: 280px; border-right: 1px solid #eee; padding: 16px; overflow:auto; }
    .content { flex:1; position:relative; padding: 0; display:flex; align-items:center; justify-content:center; }
    .layer-item { padding: 10px 12px; border:1px solid #e5e7eb; border-radius: 8px; margin-bottom:10px; cursor:pointer; display:flex; justify-content:space-between; align-items:center; }
    .layer-item:hover { background:#f9fafb; }
    .layer-badge { font-size: 10px; background:#eef2ff; color:#3730a3; padding:2px 6px; border-radius:10px; }
    .overlay-backdrop { position:fixed; inset:0; background:rgba(0,0,0,0.35); display:none; align-items:flex-end; justify-content:center; z-index: 1000; }
    .overlay-panel { background:#fff; width: min(720px, 92vw); max-height: 60vh; border-radius: 12px 12px 0 0; overflow:auto; padding: 16px; }
    .overlay-title { font-weight:600; margin:0 0 8px 0; }
    .text-item { padding:8px 10px; border:1px dashed #e5e7eb; border-radius:8px; margin-bottom:8px; }
    .footer { font-size:12px; color:#666; }
    #stage { width: 100%; height: 100vh; background:#fafafa; touch-action: none; -ms-touch-action: none; }
    .layer-group { cursor:default; transition: all 0.2s ease; }
    .layer-group.has-overlay { cursor:pointer; }
    .layer-group.has-overlay:hover {
      filter: drop-shadow(0 4px 8px rgba(13, 140, 232, 0.3));
      transform: translateY(-1px);
    }
    .layer-group.has-overlay:hover path {
      stroke: #0d8ce8;
      stroke-width: 2.5;
      filter: brightness(1.1);
    }
    .layer-group.has-overlay:active {
      transform: translateY(0px);
      filter: drop-shadow(0 2px 4px rgba(13, 140, 232, 0.4));
    }
    .layer-group:not(.has-overlay):hover path {
      stroke: #9ca3af;
      stroke-width: 1.5;
      opacity: 0.7;
    }
    .toolbar { position:absolute; right:16px; top:16px; display:flex; gap:8px; z-index:5; }
    .btn { background:#fff; border:1px solid #e5e7eb; padding:6px 10px; border-radius:6px; cursor:pointer; font-size:12px; }
    .btn:hover { background:#f9fafb; }
    @media (max-width: 768px) {
      .sidebar { display: none; }
      .container { display: block; }
      .toolbar { right: 8px; top: 8px; }
      #stage { height: 100vh; }
    }

    /* iOS Safari specific optimizations */
    .ios-safari #stage {
      -webkit-touch-callout: none;
      -webkit-user-select: none;
      -webkit-tap-highlight-color: transparent;
      touch-action: manipulation;
    }

    .ios-safari .layer-group.has-overlay:active {
      -webkit-tap-highlight-color: rgba(13, 140, 232, 0.1);
    }

    /* iOS Chrome specific optimizations */
    .ios-chrome #stage {
      touch-action: pan-x pan-y pinch-zoom;
      -webkit-overflow-scrolling: touch;
    }

    .ios-chrome .toolbar {
      -webkit-backdrop-filter: blur(10px);
      backdrop-filter: blur(10px);
    }

    /* General mobile optimizations */
    @media (max-width: 768px) and (orientation: landscape) {
      #stage { height: calc(100vh - 60px); }
      .toolbar { top: 8px; }
    }

    @media (max-width: 768px) and (orientation: portrait) {
      #stage { height: calc(100vh - 80px); }
      .toolbar { top: 12px; }
    }

    /* Mobile BIM overlay optimizations */
    @media (max-width: 768px) {
      .overlay-backdrop { 
        align-items: flex-end; 
        padding: 0; 
        z-index: 1000; 
      }
      .overlay-panel { 
        width: 100vw; 
        max-width: 100vw; 
        max-height: 70vh; 
        border-radius: 16px 16px 0 0; 
        margin: 0; 
        padding: 20px; 
        box-shadow: 0 -8px 32px rgba(0, 0, 0, 0.3);
        transform: translateY(100%);
        transition: transform 0.3s ease-out;
      }
      .overlay-backdrop.show .overlay-panel {
        transform: translateY(0);
      }
      .overlay-title { 
        font-size: 18px; 
        margin-bottom: 16px; 
        text-align: center;
        border-bottom: 1px solid #e5e7eb;
        padding-bottom: 12px;
      }
      .text-item { 
        padding: 12px 16px; 
        font-size: 14px; 
        line-height: 1.5;
        margin-bottom: 12px;
        border-radius: 12px;
      }
    }
  </style>

      <div id="hover-info" style="margin-top: 20px; padding: 12px; background: #f8fafc; border-radius: 8px; border-left: 3px solid #0d8ce8; display: none;">
        <div style="font-weight: 600; font-size: 12px; color: #0d8ce8; margin-bottom: 4px;">HOVERING</div>
        <div id="hover-layer-name" style="font-size: 14px; font-weight: 500;"></div>
        <div style="font-size: 11px; color: #666; margin-top: 4px;">Click to view BIM info</div>
      </div>
    </aside>
    <main class="content">
      <div class="toolbar">
        <button id="fitWidth" class="btn">Fit Width</button>
        <button id="fitHeight" class="btn">Fit Height</button>
        <button id="fitAll" class="btn">Fit All</button>
      </div>
      <svg id="stage" xmlns="http://www.w3.org/2000/svg"></svg>
    </main>
  </div>
  <div id="backdrop" class="overlay-backdrop" aria-hidden="true">
    <div class="overlay-panel">
      <h3 id="ov-title" class="overlay-title"></h3>
      <div id="ov-body"></div>
    </div>
  </div>
  <script>
    (async function(){
      // 加载数据：优先来自内嵌，否则回退到 /figma-ready.json
      let shapes = (window.__FIGMA_READY__ || []);
      if (!shapes || !Array.isArray(shapes) || shapes.length === 0 || window.__USE_FETCH__) {
        try {
          const resp = await fetch('/figma-ready.json', { cache: 'no-store' });
          const j = await resp.json();
          shapes = (j && j.shapes) ? j.shapes : [];
        } catch(e) {
          console.error('Load data failed:', e);
          const err = document.createElement('div');
          err.style.color = '#b91c1c'; err.style.padding = '12px'; err.textContent = 'Failed to load data: ' + (e && e.message ? e.message : e);
          document.querySelector('.content').appendChild(err);
          return;
        }
      }
      const framesById = {};
      shapes.forEach(s=>{ if (s.type==='FRAME' && s.id) framesById[s.id] = s; });
      const textsByFrame = {};
      shapes.forEach(s=>{ if (s.type==='TEXT' && s.parentFrameId){ if (!textsByFrame[s.parentFrameId]) { textsByFrame[s.parentFrameId] = []; } textsByFrame[s.parentFrameId].push(s); }});

      const overlayByLayer = {};
      shapes.forEach(s=>{
        if (s.type==='TEXT' && s.parentFrameId){
          const fr = framesById[s.parentFrameId];
          if (fr && (fr.frameCategory==='BIM' || fr.layer==='BIM-Frame')){
            const layer = s.layer || '';
            if (layer && !overlayByLayer[layer]) {
              overlayByLayer[layer] = s.parentFrameId;
              console.log('🔗 Mapped overlay:', layer, '->', s.parentFrameId);
            }
          }
        }
      });
      console.log('📊 Final overlayByLayer:', overlayByLayer);

      const vectors = shapes.filter(s=>s.type==='VECTOR');
      const layers = Array.from(new Set(vectors.map(s=>s.layer||'Unlayered')));
      const layersEl = document.getElementById('layers');
      layers.forEach(layer=>{
        const hasOverlay = !!overlayByLayer[layer];
        const item = document.createElement('div');
        item.className = 'layer-item';
        item.innerHTML = '<span>'+layer+'</span>';
        item.addEventListener('click', ()=>{
          if (!hasOverlay) return;
          const frameId = overlayByLayer[layer];
          const texts = textsByFrame[frameId] || [];
          openOverlay(layer, texts);
        });
        layersEl.appendChild(item);
      });

      // 绘制 SVG：按 parentFrameId + layer 分组，并将每组设为可点击
      const stage = document.getElementById('stage');
      // 计算全局包围盒（包含矢量与文本）
      let minX = Infinity, minY = Infinity, maxX = -Infinity, maxY = -Infinity;
      vectors.forEach(v => {
        minX = Math.min(minX, v.x);
        minY = Math.min(minY, v.y);
        maxX = Math.max(maxX, v.x + v.width);
        maxY = Math.max(maxY, v.y + v.height);
      });
      const allTexts = shapes.filter(s=>s.type==='TEXT');
      allTexts.forEach(t => {
        // 视作点参与包围盒
        minX = Math.min(minX, t.x || 0);
        minY = Math.min(minY, t.y || 0);
        maxX = Math.max(maxX, (t.x || 0));
        maxY = Math.max(maxY, (t.y || 0));
      });
      if (!isFinite(minX) || !isFinite(minY) || !isFinite(maxX) || !isFinite(maxY)) { minX=0; minY=0; maxX=1000; maxY=800; }
      // 加 buffer
      var buffer = 50;
      minX -= buffer; minY -= buffer; maxX += buffer; maxY += buffer;
      var fullW = Math.max(1, maxX - minX);
      var fullH = Math.max(1, maxY - minY);

      // 视图窗口（可缩放平移）
      var vx = 0, vy = 0, vw = fullW, vh = fullH;
      function applyViewBox(){ stage.setAttribute('viewBox', vx + ' ' + vy + ' ' + vw + ' ' + vh); }
      applyViewBox();

      // 构建分组
      const groups = {};
      vectors.forEach(v => {
        const fid = v.parentFrameId || 'root';
        const layer = v.layer || 'Unlayered';
        const key = fid + '::' + layer;
        if (!groups[key]) { groups[key] = []; }
        groups[key].push(v);
      });

      Object.entries(groups).forEach(([key, list]) => {
        const layer = key.split('::')[1];
        const g = document.createElementNS('http://www.w3.org/2000/svg', 'g');
        g.classList.add('layer-group');
        g.setAttribute('data-layer', layer);
        
        // Hover事件：显示layer信息
        const hoverInfo = document.getElementById('hover-info');
        const hoverLayerName = document.getElementById('hover-layer-name');
        const hasOverlay = !!overlayByLayer[layer];
        
        // 添加CSS类来区分是否有overlay
        if (hasOverlay) {
          g.classList.add('has-overlay');
        }
        
        g.addEventListener('mouseenter', () => {
          hoverLayerName.textContent = layer;
          hoverInfo.style.display = 'block';
          if (!hasOverlay) {
            hoverInfo.style.opacity = '0.6';
            hoverInfo.style.borderLeftColor = '#9ca3af';
          } else {
            hoverInfo.style.opacity = '1';
            hoverInfo.style.borderLeftColor = '#0d8ce8';
          }
        });
        
        g.addEventListener('mouseleave', () => {
          hoverInfo.style.display = 'none';
        });
        
        // 点击组：若该 layer 有 overlay，则打开
        g.addEventListener('click', (evt) => {
          console.log('🖱️ Layer group clicked:', layer);
          evt.stopPropagation();
          const frameId = overlayByLayer[layer];
          console.log('🔍 frameId for layer:', frameId);
          if (!frameId) {
            console.log('❌ No frameId found for layer:', layer);
            return;
          }
          const texts = textsByFrame[frameId] || [];
          console.log('📝 Found texts:', texts.length);
          openOverlay(layer, texts);
        });
        // 绘制该组内的几何
        list.forEach(v => {
          const vg = document.createElementNS('http://www.w3.org/2000/svg', 'g');
          const tx = (v.x - minX);
          const ty = (v.y - minY);
          vg.setAttribute('transform', 'translate(' + tx + ', ' + ty + ')');
          const path = document.createElementNS('http://www.w3.org/2000/svg', 'path');
          const d = (v.vectorPaths && v.vectorPaths[0] && v.vectorPaths[0].data) ? v.vectorPaths[0].data : '';
          path.setAttribute('d', d);
          path.setAttribute('fill', 'none');
          path.setAttribute('stroke', '#111');
          path.setAttribute('stroke-width', String(v.strokeWeight || 1));
          vg.appendChild(path);
          g.appendChild(vg);
        });
        stage.appendChild(g);
      });

      // 绘制文本（直接渲染到画布上，便于核对数据是否存在）- 只渲染Text图层的文本
      allTexts.filter(t => t.layer === 'Text').forEach(t => {
        var tx = (t.x - minX);
        var ty = (t.y - minY);
        var textEl = document.createElementNS('http://www.w3.org/2000/svg', 'text');
        textEl.setAttribute('x', String(tx));
        textEl.setAttribute('y', String(ty));
        textEl.setAttribute('font-size', String(t.fontSize || 12));
        textEl.setAttribute('dominant-baseline', 'hanging');
        textEl.setAttribute('text-anchor', 'start');
        var fill = '#111';
        try {
          var f = (t.fills && t.fills[0] && t.fills[0].color) ? t.fills[0].color : null;
          if (f) {
            var rr = Math.max(0, Math.min(255, Math.round((f.r||0)*255)));
            var gg = Math.max(0, Math.min(255, Math.round((f.g||0)*255)));
            var bb = Math.max(0, Math.min(255, Math.round((f.b||0)*255)));
            fill = 'rgb(' + rr + ',' + gg + ',' + bb + ')';
          }
        } catch(e){}
        textEl.setAttribute('fill', fill);
        // 安全兼容换行，不使用正则，避免转义问题
        var rawTxt = (t.text || '');
        var norm = '';
        for (var i=0;i<rawTxt.length;i++){
          var chCode = rawTxt.charCodeAt(i);
          if (chCode === 13) { // CR
            // CRLF: skip next LF
            if (i+1 < rawTxt.length && rawTxt.charCodeAt(i+1) === 10) { i++; }
            norm += '\n';
          } else if (chCode === 10) { // LF
            norm += '\n';
          } else {
            norm += rawTxt[i];
          }
        }
        var content = norm.split('\n');
        if (content.length <= 1) {
          textEl.textContent = content[0] || '';
        } else {
          var lineH = (t.fontSize || 12) * 1.2;
          content.forEach(function(line, idx){
            var tsp = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
            tsp.setAttribute('x', String(tx));
            if (idx === 0) { tsp.setAttribute('dy', '0'); }
            else { tsp.setAttribute('dy', String(lineH)); }
            tsp.textContent = line;
            textEl.appendChild(tsp);
          });
        }
        stage.appendChild(textEl);
      });

      // 交互：缩放与平移
      document.getElementById('fitWidth').addEventListener('click', function(){
        // 适应宽度：将内容宽度完全适配到视口宽度
        const stageRect = stage.getBoundingClientRect();
        const viewportAspectRatio = stageRect.width / stageRect.height;
        const contentAspectRatio = fullW / fullH;
        
        vx = 0; 
        vy = 0; 
        vw = fullW;
        vh = fullW / viewportAspectRatio;
        
        // 如果计算出的高度小于内容高度，需要垂直居中
        if (vh < fullH) {
          const offsetY = (fullH - vh) / 2;
          vy = offsetY;
        }
        
        applyViewBox();
      });
      
      document.getElementById('fitHeight').addEventListener('click', function(){
        // 适应高度：将内容高度完全适配到视口高度
        const stageRect = stage.getBoundingClientRect();
        const viewportAspectRatio = stageRect.width / stageRect.height;
        const contentAspectRatio = fullW / fullH;
        
        vx = 0; 
        vy = 0; 
        vh = fullH;
        vw = fullH * viewportAspectRatio;
        
        // 如果计算出的宽度小于内容宽度，需要水平居中
        if (vw < fullW) {
          const offsetX = (fullW - vw) / 2;
          vx = offsetX;
        }
        
        applyViewBox();
      });
      
      document.getElementById('fitAll').addEventListener('click', function(){
        // 适应全部内容：显示所有内容并保持宽高比
        vx = 0; 
        vy = 0; 
        vw = fullW; 
        vh = fullH; 
        applyViewBox();
      });
      
      var isPanning = false, startX = 0, startY = 0;
      stage.addEventListener('mousedown', function(e){ isPanning = true; startX = e.clientX; startY = e.clientY; });
      window.addEventListener('mouseup', function(){ isPanning = false; });
      window.addEventListener('mousemove', function(e){ if (!isPanning) return; var dx = e.clientX - startX; var dy = e.clientY - startY; startX = e.clientX; startY = e.clientY; var scaleX = vw / stage.clientWidth; var scaleY = vh / stage.clientHeight; vx -= dx * scaleX; vy -= dy * scaleY; applyViewBox(); });
      // 恢复滚轮缩放功能
      var zoomStep = 0.9; // 每次缩放比例
      stage.addEventListener('wheel', function(e){ 
        e.preventDefault(); 
        var factor = (e.deltaY < 0) ? zoomStep : (1/zoomStep); 
        vw *= factor; 
        vh *= factor; 
        applyViewBox(); 
      }, { passive:false });

      // 移动端：Pointer 事件支持单指平移与双指捏合缩放
      var activePointers = new Map();
      var lastPinchDistance = null;
      function getTwoPointerInfo(){
        var arr = Array.from(activePointers.values());
        if (arr.length !== 2) return null;
        var dx = arr[0].x - arr[1].x;
        var dy = arr[0].y - arr[1].y;
        var cx = (arr[0].x + arr[1].x) / 2;
        var cy = (arr[0].y + arr[1].y) / 2;
        return { distance: Math.hypot(dx, dy), centerX: cx, centerY: cy };
      }
      stage.addEventListener('pointerdown', function(e){
        stage.setPointerCapture(e.pointerId);
        activePointers.set(e.pointerId, { x: e.clientX, y: e.clientY });
        if (activePointers.size === 1) {
          isPanning = true; startX = e.clientX; startY = e.clientY;
        }
        var info = getTwoPointerInfo();
        lastPinchDistance = info ? info.distance : null;
      });
      window.addEventListener('pointermove', function(e){
        if (!activePointers.has(e.pointerId)) return;
        activePointers.set(e.pointerId, { x: e.clientX, y: e.clientY });
        if (activePointers.size === 1 && isPanning) {
          var dx = e.clientX - startX; var dy = e.clientY - startY;
          startX = e.clientX; startY = e.clientY;
          var scaleX = vw / stage.clientWidth; var scaleY = vh / stage.clientHeight;
          vx -= dx * scaleX; vy -= dy * scaleY; applyViewBox();
        } else if (activePointers.size === 2) {
          var info = getTwoPointerInfo();
          if (info && lastPinchDistance) {
            var rect = stage.getBoundingClientRect();
            var px = (info.centerX - rect.left) / rect.width;
            var py = (info.centerY - rect.top) / rect.height;
            var factor = lastPinchDistance / info.distance;
            // 围绕双指中心缩放
            vx += vw * px * (1 - factor);
            vy += vh * py * (1 - factor);
            vw *= factor; vh *= factor; applyViewBox();
          }
          lastPinchDistance = info ? info.distance : null;
        }
      });
      function endPointer(e){
        activePointers.delete(e.pointerId);
        if (activePointers.size === 0) { isPanning = false; lastPinchDistance = null; }
        if (activePointers.size < 2) { lastPinchDistance = null; }
      }
      window.addEventListener('pointerup', endPointer);
      window.addEventListener('pointercancel', endPointer);

      const backdrop = document.getElementById('backdrop');
      const ovTitle = document.getElementById('ov-title');
      const ovBody = document.getElementById('ov-body');
      function openOverlay(layerName, texts){
        console.log('🚀 openOverlay called:', { layerName, textsCount: texts.length });
        console.log('📋 backdrop element:', backdrop);
        
        ovTitle.textContent = 'BIM-Frame-' + layerName;
        ovBody.innerHTML = '';
        if (texts.length===0){
          const p = document.createElement('div');
          p.textContent = 'No text content in overlay.';
          ovBody.appendChild(p);
        } else {
          texts.forEach(t=>{
            const div = document.createElement('div');
            div.className = 'text-item';
            div.textContent = t.text || '';
            ovBody.appendChild(div);
          });
        }
        
        console.log('💡 Setting backdrop display to flex...');
        backdrop.style.display = 'flex';
        console.log('✅ backdrop display set:', backdrop.style.display);
        
        // 移动端优化：延迟添加show类以触发动画
        if (window.innerWidth <= 768) {
          setTimeout(() => {
            backdrop.classList.add('show');
          }, 10);
        }
      }
      backdrop.addEventListener('click', (e)=>{
        if (e.target === backdrop){ 
          // 移动端优化：先移除show类触发关闭动画，然后隐藏
          if (window.innerWidth <= 768) {
            backdrop.classList.remove('show');
            setTimeout(() => {
              backdrop.style.display = 'none';
            }, 300); // 等待动画完成
          } else {
            backdrop.style.display = 'none';
          }
        }
      });
    })();
  </script>
</body>
</html>
